import React, { useContext, useEffect, useReducer } from 'react'
import { Helmet } from 'react-helmet-async';
import { ToastContainer } from 'react-toastify';
import { Store } from '../../Store';
import Footer from '../Component/Footer';
import Nav from '../Component/Nav';
import Sidebar from '../Component/Sidebar';
import {jobReducer} from '../../JobReducer'
import axios from '../../axios';
import { AdminJobItem } from '../Component/AdminJobItem';
import Spiner from '../../components/Spiner';
export const AdminJobs = () => {
    const {state} = useContext(Store)
    const {user} = state;

    const [loading, jobs, error, {dispatch}] = useReducer(jobReducer, {
        jobs: [],
        loading: true,
        error: ''
    });

    useEffect(() =>{
       const fetchJobs = async() =>{
            try {
                 dispatch({ type: "FETCH_REQUEST" });
                const { data } = await axios.get("/myjobs/mine", {
                   headers: { Authorization: `Bearer ${user.token}` },
                 });
                  dispatch({ type: "FETCH_SUCCESS", payload: data });
            } catch (error) {
                 dispatch({ type: "FETCH_FAIL", payload: error});
                
            }
           

        }
    })
  return (
    <div>
      <ToastContainer />
      <Helmet>
        <title>Jobs</title>
      </Helmet>
      <Nav />
      <Sidebar />
      <main id="main" className="main">
        <div className="pagetitle">
          <h1>TheEmployer</h1>
          <nav>
            <ol className="breadcrumb">
              <li className="breadcrumb-item">
                <a href="/">Home</a>
              </li>
              <li className="breadcrumb-item active">Dashboard</li>
            </ol>
          </nav>
        </div>

        <section className="section dashboard">
          <div className="list-job">
            <div className="container py-3 bg-white">
              {loading ? (
                <Spiner />
              ) : error ? (
                toast.success(error)
              ) : (
                <>
                  {user && user.isAdmin === true ? (
                    <div className="container">
                      <Link to="/adminnewcat">
                        <button className="btn btn-primary">Add New</button>
                      </Link>
                    </div>
                  ) : (
                    ""
                  )}

                  <div className="data-table">
                    <table className="table">
                      <thead>
                        <tr>
                          <th>ID</th>
                          <th>NAME</th>
                          <th>ACTIONS</th>
                          <th>ACTIONS</th>
                        </tr>
                      </thead>
                      <tbody>
                        {category.map((cat) => (
                          <tr key={cat._id}>
                            <td>No.c</td>
                            <td>{cat.name}</td>
                            <td>
                              <button
                                type="button"
                                data-toggle="modal"
                                data-target="#exampleModal"
                                className="btn btn-secondary"
                                disabled={user.isAdmin === false}
                                onClick={() =>
                                  navigate(`/editcat/${cat.name}/${cat._id}`)
                                }
                              >
                                Edit
                              </button>
                            </td>
                            <td>
                              <button
                                type="button"
                                variant="danger"
                                className="btn btn-danger"
                                disabled={user.isAdmin === false}
                                onClick={() => deleteHandler(cat)}
                              >
                                Delete
                              </button>
                            </td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                </>
              )}
            </div>
          </div>
        </section>
      </main>

      <Footer />
    </div>
  );
}
